  true,\n\t\"url\": null,\n\t\"notes\": \"Advanced Telecommunications in U.S. Private
  Schools, 1998-99 (FRSS 68), is a study that is part of the Fast Response Survey
  System (FRSS) program; program data is available since 1998-99 at http://nces.ed.gov/surveys/frss/downloads.asp.
  FRSS 68 http://nces.ed.gov/surveys/frss/index.asp is a cross-sectional study that
  collected data about computer and internet availability and use in private elementary
  and secondary schools in the United States. The study was conducted using surveys
  of heads of private schools. Private schools in the United States were sampled.
  The study's unweighted response rate was 86 percent and the weighted response rate
  was 84 percent. Key statistics from FRSS 68 are on the availability and use of computers
  and the internet in private schools.\",\n\t\"license_title\": \"Creative Commons
